import React, { useState } from "react";

const DeleteOwner = () => {
  const [ownerCode, setOwnerCode] = useState("");
  const [ownerData, setOwnerData] = useState(null);
  const [message, setMessage] = useState("");

  const handleSearch = async (e) => {
    e.preventDefault();
    setOwnerData(null);
    setMessage("");

    try {
      const res = await fetch(`http://localhost:5000/owners/${ownerCode}`, {
        method: "GET",
        credentials: "include",
      });
      const data = await res.json();
      if (res.ok && data.success) {
        setOwnerData(data.owner);
      } else {
        setMessage(data.message || "Owner not found");
      }
    } catch (err) {
      console.error(err);
      setMessage("❌ Error fetching owner");
    }
  };

  const handleDelete = async (e) => {
    e.preventDefault();
    if (!ownerData) return;
    if (!window.confirm("Are you sure you want to delete this owner?")) return;

    try {
      const res = await fetch("http://localhost:5000/delete_owner", {
        method: "POST",
        credentials: "include",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ owner_code: ownerData.owner_code }),
      });
      const data = await res.json();
      if (res.ok && data.success) {
        setMessage(data.message);
        setOwnerData(null);
        setOwnerCode("");
      } else {
        setMessage(data.message || "❌ Error deleting owner");
      }
    } catch (err) {
      console.error(err);
      setMessage("❌ Error deleting owner");
    }
  };

  return (
    <div className="container" style={{ maxWidth: "1200px", margin: "auto", padding: "20px", background: "#fff", borderRadius: "8px", boxShadow: "0 0 10px rgba(0,0,0,0.1)" }}>
      <h2 style={{ textAlign: "center", marginBottom: "20px" }}>Delete Owner</h2>

      {message && (
        <p style={{ textAlign: "center", fontWeight: "bold", marginBottom: "15px", color: message.includes("✅") ? "green" : "red" }}>
          {message}
        </p>
      )}

      <form onSubmit={handleSearch} style={{ textAlign: "center", marginBottom: "20px" }}>
        <input
          type="text"
          value={ownerCode}
          onChange={(e) => setOwnerCode(e.target.value)}
          placeholder="Owner Code"
          required
          style={{ width: "120px", marginRight: "5px", padding: "6px" }}
        />
        <button type="submit" style={{ padding: "6px 12px" }}>Search</button>
      </form>

      {ownerData && (
        <form onSubmit={handleDelete} encType="multipart/form-data">
          <input type="hidden" name="owner_code" value={ownerData.owner_code} />

          {/* Row 1 */}
          <div className="row">
            {["salutation", "first_name", "last_name", "nationality"].map((field) => (
              <div key={field} className="col-md-3">
                <label>{field.replace("_", " ").replace(/\b\w/g, c => c.toUpperCase())}:</label>
                <input type="text" value={ownerData[field] || ""} readOnly style={{ width: "100%" }} />
              </div>
            ))}
          </div>

          {/* Row 2 */}
          <div className="row">
            {["address1", "address2", "city", "state"].map((field) => (
              <div key={field} className="col-md-3">
                <label>{field.replace("_", " ").replace(/\b\w/g, c => c.toUpperCase())}:</label>
                <input type="text" value={ownerData[field] || ""} readOnly style={{ width: "100%" }} />
              </div>
            ))}
          </div>

          {/* Row 3 */}
          <div className="row">
            {["country", "zip_code", "mobile_number", "email"].map((field) => (
              <div key={field} className="col-md-3">
                <label>{field.replace("_", " ").replace(/\b\w/g, c => c.toUpperCase())}:</label>
                <input type={field.includes("email") ? "email" : "text"} value={ownerData[field] || ""} readOnly style={{ width: "100%" }} />
              </div>
            ))}
          </div>

          {/* Row 4 */}
          <div className="row">
            {["passport_number", "date_of_birth", "visa_expiry_date", "passport_expiry_date"].map((field) => (
              <div key={field} className="col-md-3">
                <label>{field.replace("_", " ").replace(/\b\w/g, c => c.toUpperCase())}:</label>
                <input type={field.includes("date") ? "date" : "text"} value={ownerData[field] || ""} readOnly style={{ width: "100%" }} />
              </div>
            ))}
          </div>

          {/* Row 5 - Images */}
          <div className="row" style={{ marginTop: "10px" }}>
            {[
              ["Emirates ID", "eid_image"],
              ["Passport Copy", "passport_copy"],
              ["Residence Visa", "res_visa"],
            ].map(([label, field]) => (
              <div key={field} className="col-md-4">
                <label>{label}</label>
                {ownerData[field] ? (
                  <img
                    src={`data:image/jpeg;base64,${ownerData[field]}`}
                    alt={label}
                    style={{ maxWidth: "100px", maxHeight: "80px", display: "block", marginTop: "5px" }}
                  />
                ) : (
                  <p style={{ fontSize: "0.8rem", color: "#666" }}>No file</p>
                )}
              </div>
            ))}
          </div>

          <div style={{ textAlign: "center", marginTop: "20px" }}>
            <button type="submit" style={{ padding: "8px 16px", background: "#c0392b", color: "white", border: "none", borderRadius: "4px" }}>
              Delete Owner
            </button>
          </div>
        </form>
      )}
    </div>
  );
};

export default DeleteOwner;
